import { VFC } from 'react';
import styled from "styled-components";

type HeaderIconLinkProps = {
    href: string,
    src: string,
    alt: string
}

const HeaderIconLink:VFC<HeaderIconLinkProps> = ({href,src,alt})=> {
    return(
        <StyledHeaderIconLink href={href}><img src={src} alt={alt}></img></StyledHeaderIconLink>
    )
}

const StyledHeaderIconLink =styled.a`
    width:10%;
    margin:0.5%;
&:hober{
    background:orange;
}
`;

export default HeaderIconLink;
